import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import '../SignStyle.css';


export class SignUp extends Component {


    state = {
        user_inf: [
            { user_name: "", user_pass: "", user_email: "" }]
    }


    registerUser = (newName) => {

        this.setState({
            user_inf: [
                { user_name: newName, user_pass: "", user_email: "" }]

        })
    }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown">
                    <div id="formContent">
                        <h2 className="active signh2"> Sign Up </h2>

                        <div className="fadeIn first mt-2 mb-2">
                            <i className="fa-solid fa-user fa-6x"></i>
                        </div>

                        <form>
                            <input onKeyDown={this.registerUser("Yes")} type="text" id="login" className="fadeIn second" name="login" placeholder="Email adress" />
                            <input type="text" id="login" className="fadeIn second" name="login" placeholder="Verify email" />
                            <input type="password" id="password" className="fadeIn third" name="login" placeholder="password" />
                            <input type="password" id="password" className="fadeIn third" name="login" placeholder="re-enter password" />
                            <input onClick={this.registerUser} type="submit" className="fadeIn fourth" value="Sign up" />
                        </form>

                        <div id="formFooter">
                            <Link className="underlineHover" to="/login">Already a member ?</Link>
                        </div>

                    </div>
                </div></div>
        )
    }
}

export default SignUp
